(function($) {

	$.sgCarousel = function(element, options) {

		var defaults = {
			totSlides: 0,
			currSlide: null,
			zIndex: 1,
			clicked: false,
			restart: false,
			$slides: null,
			$prevBtn: null,
			$nextBtn: null,
			$pagination: null,
			sliderSize: 0
		};

		var plugin = this;

		plugin.settings = {};

		var $element = $(element),
			element = element;

		plugin.init = function() {

			// the plugin's final properties are the merged default and 
			// user-provided options (if any)
			plugin.settings = $.extend({}, defaults, options);

			defaults.totSlides = $element.find('.slide').length;
			defaults.$slides = $element.find('.slide');
			defaults.currSlide = 0;
			defaults.$prevBtn = $element.find('.prev-sg-slide');
			defaults.$nextBtn = $element.find('.next-sg-slide');
			defaults.$pagination = $element.find('.sg-pagination');
			defaults.sliderSize = $element.find('img').innerWidth();

			defaults.$slides.each(function(index, item) {
				if (index == defaults.currSlide) {
					$(item).css({
						'clip': 'rect(auto ' + defaults.sliderSize + 'px auto 0)',
						'transform': 'translateX(0)',
						'z-index': defaults.zIndex
					}).addClass('animate active');
					//$pagination.css('z-index', zIndex+20);
				} else {
					$(item).css({
						'clip': 'rect(auto 0 auto 0)',
						'transform': 'translateX(-5%)'
					});
				}
			});

			defaults.$pagination.find('li').css('width', Math.round(100/defaults.totSlides * 10000)/10000 + '%');

			update_pagination();

			defaults.$prevBtn.on('click', function(event) {
				event.preventDefault();
				if ( !defaults.clicked ) {
					defaults.clicked = true;
					plugin.prevSlide();
				}
			});

			defaults.$nextBtn.on('click', function(event) {
				event.preventDefault();

				if ( !defaults.clicked ) {
					defaults.clicked = true;
					plugin.nextSlide();
				}
			});

			var mc = new Hammer(element);
			mc.on('swipeleft', function(ev) {
				if ( !defaults.clicked ) {
					defaults.clicked = true;
					plugin.prevSlide();
				}
			}).on('swiperight', function(ev) {
				if ( !defaults.clicked ) {
					defaults.clicked = true;
					plugin.nextSlide();
				}
			});

			$(window).on('resize', function() {
				defaults.sliderSize = $element.find('img').innerWidth();
			});

			setInterval(function() {
				if ( !defaults.clicked ) {
					defaults.clicked = true;
					plugin.nextSlide();
				}
			}, 4000);

		};

		plugin.prevSlide = function() {
			//helpers.increase_btns_zindex();

			var prevS = defaults.currSlide;

			$(defaults.$slides[defaults.currSlide]).addClass('animate').css({
				'clip': 'rect(auto 0 auto 0)',
				'transform': 'translateX(0)'
			});

			defaults.currSlide--;

			if (defaults.currSlide == -1) {
				defaults.currSlide = defaults.totSlides-1;
			}

			$(defaults.$slides[defaults.currSlide]).css({
				'transform': 'translateX(5%)',
				'clip': 'rect(auto ' + defaults.sliderSize + 'px auto 0px)'
			});
			defaults.$slides.removeClass('active');
			setTimeout(function() {
				$(defaults.$slides[defaults.currSlide]).addClass('animate active').css({
					'transform': 'translateX(0)',
					'clip': 'rect(auto ' + defaults.sliderSize + 'px auto 0px)'
				});
			}, 100);

			reset_slide_prev(prevS, defaults.currSlide);

			defaults.zIndex++;

			update_pagination();
		};

		plugin.nextSlide = function() {
			//helpers.increase_btns_zindex();
			reset_slide_next(defaults.currSlide);

			defaults.currSlide++;

			// Penultima
			if (defaults.currSlide == defaults.totSlides-1) {
				$(defaults.$slides[0]).css({
					'clip': 'rect(auto 0 auto 0)',
					'transform': 'translateX(-5%)'
				});
			}

			// Start from begin when ends reached
			if (defaults.currSlide == defaults.totSlides) {
				defaults.currSlide = 0;
			}

			defaults.$slides.removeClass('active');

			// Left In next slide
			$(defaults.$slides[defaults.currSlide])
				.addClass('animate active')
				.css({
					'transform': 'translateX(0)',
					'clip': 'rect(auto ' + defaults.sliderSize + 'px auto 0)',
					'z-index': defaults.zIndex
				});
			defaults.zIndex++;

			update_pagination();
		};


		var reset_slide_next = function(ind) {
			setTimeout(function() {
				$(defaults.$slides[ind]).removeClass('animate').css({
					'clip': 'rect(auto 0 auto 0)',
					'transform': 'translateX(-5%)'
				});
				defaults.clicked = false;
			}, 1000);
		};

		var reset_slide_prev = function(ind, currInd) {
			setTimeout(function() {
				$(defaults.$slides[ind]).removeClass('animate').css({
					'clip': 'rect(auto 0 auto 0)',
					'transform': 'translateX(-5%)'
				});
				$(defaults.$slides[currInd]).removeClass('animate').css({
					'z-index': defaults.zIndex
				});
				defaults.clicked = false;
			}, 1000);
		};

		var increase_btns_zindex = function() {
			$prevBtn.css('z-index', zIndex+20);
			$nextBtn.css('z-index', zIndex+20);
			$pagination.css('z-index', zIndex+20);
		};

		var update_pagination = function() {
			defaults.$pagination.find('li').each(function(index, item) {
				$(item).removeClass('active');
				if (index <= defaults.currSlide) {
					$(item).addClass('active');
				}
			});
		};

		plugin.init();

	};


	$.fn.sgCarousel = function(options) {
		return this.each(function() {
			if (undefined == $(this).data('sgCarousel')) {
				var plugin = new $.sgCarousel(this, options);
				$(this).data('sgCarousel', plugin);
			}
		});
	}

})(jQuery);

