function animateMenuItemsIn(content) {
	anime({
		targets: content,
		easing: 'easeOutExpo',
		duration: 600,
		delay: function(t, i) {
			return i*30;
		},
		translateY: function(t, i) {
			return [50+10*i,0];
		},
		opacity: {
			value: 1,
			duration: 600,
			easing: 'linear'
		},
		update: function(anim) {
			if( anim.progress > 60 && isSubMenuShown && companyDataEffect ) {
				if (isMobile) {
					companyDataEffect = false;
					companyDataIn();
				}
			}
		}
	});
}

function animateMenuItemsOut(content, hideMenu, hideSubmenu) {
	anime({
		targets: content,
		easing: 'easeOutExpo',
		duration: 600,
		delay: function(t,i,c) {
			//return 0;
			return (c-i-1)*20;
		},
		translateY: function(t,i) {
			return [0,50+10*i];
		},
		opacity: {
			value: 0,
			duration: 100,
			easing: 'linear'
		},
		update: function(anim) {
			if ( hideMenu ) {
				if( anim.progress > 60 && isMenuShown ) {
					isMenuShown = false;
					closeMenu();
				}
			}
			if ( hideSubmenu ) {
				if( anim.progress > 60 && isSubMenuShown ) {
					isSubMenuShown = false;
					closeSubMenu();
					if (isMobile) {
						companyDataIn();
					}
				}
			}
		}
	});
}

